Mais uma da Série : 'Advogado do Diabo';
https://youtu.be/7rQBRpd8Hw8
E tem aqueles que batem palmas aos 'Deuses do Supremo' !

Pessoal falando do Caio, só leio uma linha de crítica:
- Caio apanhou;
- Caio tem um computador;
- Caio Copanno;
- Etc, etc, etc;

Agora contrapor as ideias dele... Nada!

Augusto querendo comparar as operações da PF com conduções coercitivas a políticos na lava jato, com cidadãos comuns? Sério? Desde que vejo esse Augusto ele idolatra o STF! Ele defendeu O Alexandre de Moraes no ato de impedir nomeação de cargo no executivo, baseado em achismo, achar que vai haver crime...

Caio fechou citando os artigos da lei de segurança que o Alexandre usou pra enquadrar o ministro da educação, um malabarismo terrível, e o que o Augusto falou disso? Nada... Pois contra fatos né? Vcs já sabem! Não vi o Caio apanhando em momento algum, desculpem!
